import React, {Component} from 'react';
import './Provider.css'

class Provider extends Component {
    render() {
        return (
            <div id="provider">
                <div className="container">
                    <h3 className="title">HomeGroup cung cấp</h3>
                    <div className="horizontal-divider"/>
                    <div className="row">
                        <div className="col-md-3 category-item">
                            <img
                                src="data:image/png;base64,"
                                className="" alt="Thiết Kế Nội Thất"/>
                            <a>
                                <h3>Thiết Kế Nội Thất</h3>
                            </a>
                            <p>Nội thất HomeGroup là một trong những công
                                ty tốt nhất trong lĩnh vực Thiết kế và Thi công Nội thất. Đội ngũ kiến trúc sư nhiều
                                năm kinh nghiệm sẽ làm hài lòng quý khách hàng.</p>
                        </div>
                        <div className="col-md-3 category-item">
                            <img
                                src="https://noithathomegroup.com/wp-content/uploads/2014/02/thicon-noithat-home-347x182_1.jpg"
                                className="" alt="Thi Công Nội Thất"/>
                            <a>
                                <h3>Thi Công Nội Thất</h3>
                            </a>
                            <p>Đội ngũ kiến trúc sư, thợ thi công nhiều năm kinh nghiệm, có tinh thần trách nhiệm
                                cao, tỉ mỉ trong từng công đoạn sẽ mang đến sự tin tưởng và yên tâm cho khách
                                hàng.</p>
                        </div>
                        <div className="col-md-3 category-item">
                            <img
                                src="https://noithathomegroup.com/wp-content/uploads/2014/02/xuong-home-347x182_1.jpg"
                                className="" alt="Sản Xuất Đồ Gỗ"/>
                            <a>
                                <h3>Sản Xuất Đồ Gỗ</h3>
                            </a>
                            <p>Nhà Xưởng rộng hơn 1500m2, Thiết bị máy móc nhập khẩu Italia, dây chuyền sản xuất tự
                                động hóa, mang lại sản phẩm hoàn hảo tới từng góc cạnh, đẹp từng chi tiết nhỏ.</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Provider;
